import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavigationBar from './components/NavigationBar';
import Header from './components/Header';
import HomePage from './components/HomePage';
import FoodPage from './components/FoodPage';
import AdventurePage from './components/AdventurePage';
import ShoppingPage from './components/ShoppingPage';
import HistoricalPage from './components/HistoricalPage';
import NightlifePage from './components/NightlifePage';
import FoodRoutes from "./components/routes/foodRoutes";

const App = () => {
  return (
    <Router>
      <NavigationBar />
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/food" element={<FoodPage />} />
        <Route path="/adventure" element={<AdventurePage />} />
        <Route path="/shopping" element={<ShoppingPage />} />
        <Route path="/historical" element={<HistoricalPage />} />
        <Route path="/nightlife" element={<NightlifePage />} />
        <Route element={<FoodRoutes />} /> // Add the FoodRoutes component
      </Routes>
    </Router>
  );
};

export default App;
